                                <p class="sc-fzomuh bjwlhu sub-section" style="box-sizing: border-box; font-size: 18px; font-weight: 600; line-height: 1.25; color: rgba(0, 0, 0, 0.8); margin: 40px 0px 24px; display: block;">Con tu informaci&oacute;n creamos tu experiencia</p>
                                <div class="sc-fzoaKM hNuJKS" style="box-sizing: border-box; font-size: 16px; line-height: 1.25; color: rgba(0, 0, 0, 0.8); margin-top: 0px;">
                                    <div style="box-sizing: border-box;"><strong style="box-sizing: border-box;">Nos basamos en tus datos para ofrecerte una experiencia personalizada para que puedas disfrutar de nuestros servicios y que podamos mejorarlos de manera continua.</strong> Dar tus&nbsp;<u style="box-sizing: border-box;"><span class="tooltip-trigger" style="box-sizing: border-box; white-space: nowrap;">datos personales</span></u> no es obligatorio, pero s&iacute; es un requisito para usar nuestros servicios. Si la informaci&oacute;n que das no es precisa, no podemos brindarte la mejor experiencia. Si das informaci&oacute;n inexacta o falsa, pueden suspenderse los servicios que brindamos o inhabilitar tu cuenta.&nbsp;<strong style="box-sizing: border-box;">Considera que podemos suspender o inhabilitar tu cuenta si no cumples con la Declaraci&oacute;n de Privacidad o con los T&eacute;rminos y Condiciones de uso del sitio.</strong><br style="box-sizing: border-box;"><br style="box-sizing: border-box;">Si eres menor de edad, no deber&iacute;as dar tu informaci&oacute;n personal ya que no tienes la capacidad legal para contratar nuestros servicios.</div>
