                        <div class="sc-fzoaKM hNuJKS"><div><strong>Podemos utilizar "cookies" y otras tecnologías de seguimiento (por ejemplo "web beacons") para conocer tus intereses, las páginas navegadas, tus patrones de tráfico y tu comportamiento. Así podremos darte un mejor servicio y acercarte contenidos y publicidades que te interesen.</strong><br><br><strong>Puedes desactivar las cookies y web beacons en cualquier momento o dar de baja la suscripción para recibir nuestros emails promocionales.</strong> Pero puede que al desactivar dichas tecnologías no puedas usar y disfrutar de todas las funcionalidades que ofrecemos.</div></div>
                        <div class="sc-fzoJus bPIkEp"><p class="sc-fzoVTD Atfvz">El procedimiento para desactivar es diferente para cada navegador, tendrás que hacerlo en cada uno de los navegadores que uses:</p><span id="desactivar-cookies" class="sc-fzokvW fHUa-dL"></span><ul class="sc-fzpisO jHQZJv"><li class="sc-fznyYp kdOAmQ"><span><div><a href="https://support.google.com/chrome/answer/95647?co=GENIE.Platform%3DDesktop&amp;oco=1&amp;hl=es-419" target="_blank">Google Chrome</a></div></span></li><li class="sc-fznyYp kdOAmQ"><span><div><a href="https://support.mozilla.org/es/kb/impedir-que-los-sitios-web-guarden-sus-preferencia" target="_blank">Mozilla Firefox</a></div></span></li><li class="sc-fznyYp kdOAmQ"><span><div><a href="https://support.apple.com/es-lamr/guide/safari/sfri11471/mac" target="_blank">Safari</a></div></span></li><li class="sc-fznyYp kdOAmQ"><span><div><a href="https://support.microsoft.com/es-ar/help/17442/windows-internet-explorer-delete-manage-cookies" target="_blank">Internet Explorer</a></div></span></li><li class="sc-fznyYp kdOAmQ"><span><div><a href="https://support.microsoft.com/es-ar/help/4027947/microsoft-edge-delete-cookies" target="_blank">Microsoft Edge</a></div></span></li><li class="sc-fznyYp kdOAmQ"><span><div><a href="https://help.opera.com/en/latest/web-preferences/#cookies" target="_blank">Opera</a></div></span></li></ul></div>

